import {Card, CardHeader, Container,Grid, CardContent, Box, Typography} from '@mui/material';
// so evertime I use the Container or Card component I get an error: Uncaught Error: Invalid hook call.
// OK so I was importing from "@mui/core" instead of "@mui/material"
function Services(){
    return(
        <Container>
            <Grid container spacing={5}
            justifyContent="center"
            alignItems="center">
                <Grid item xs={6} md={4}> 
                    <Card>
                        <CardHeader
                            title={'Basic'}

                            sx={{
                                backgroundColor: '#00FFFF',
                                color: '#3F00FF',
                            }}
                        />
                        <CardContent>
                            <Box>
                                <Typography variant='h4'
                                sx={{
                                    fontWeight: 'Bold'
                                }}
                                >
                                    $45
                                </Typography>
                                <Typography>
                                    Our base product.
                                    <br/>
                                    includes airation for an average sized yard 
                                    <br/>
                                    (2,000-4,000 sq. ft.)
                                </Typography>
                            </Box>
                        </CardContent>

                    </Card>
                </Grid>
                <Grid item xs={6} md={4}>
                    <Card>
                        <CardHeader
                            title={'Pro'}

                            sx={{
                                backgroundColor: '#00FFFF',
                                color: '#3F00FF',
                            }}

                        />
                        <CardContent>
                            <Box>
                                <Typography variant='h4'
                                sx={{
                                    fontWeight: 'Bold'
                                }}
                                >
                                    $55
                                </Typography>
                                <Typography>
                                    Informatoin about the product
                                </Typography>
                            </Box>
                        </CardContent>
                    </Card>
                </Grid>

            </Grid>
        </Container>


    )
}
export default Services;
